import React from 'react';
import Header from './Header';
import '../App.css';
import Clockbuttons from './Clockbuttons';
import { tsPropertySignature } from '@babel/types';

function App() {
  const data = [
    {id:"start",value:"start"},
    {id:"short break",value:"short break"},
    {id:"long break",value:"long break"}

  ]



  return (
    <div className="App">
        <Header title="Pomodoro Clock"/>
        {data.map((value)=>{
          <Clockbuttons value={value.value} key={value.id}/>
        })
      }
    </div>
  );
}

export default App;
